import React from "react";
import "./left-scroll.css"

class LeftScroll extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            pos: 0
        }
        this.elems = [
            'Уровень',
            'Раса',
            'Класс',
            'Характеристики',
            'Черты',
            'Предыстория',
            'Ваш персонаж',
        ]
    }

    render() {
        return (
            <div className="left-scroll-div">
                <ul>
                    <li>Уровень</li>
                    <li>Раса</li>
                    <li>Класс</li>
                    <li>Характеристики</li>
                    <li>Черты</li>
                    <li>Предыстория</li>
                    <li>Ваш персонаж</li>
                </ul>
            </div>
        );
    }
}

export default LeftScroll
